import { AppBar, Box, Toolbar, Typography } from "@mui/material";
import { useState } from "react";

function Navbar() {

  const [anchorEl, setAnchorEl] = useState(null)

  const creditCards = [
    "HDFC Bank Credit Card",
    "SBI Credit Card",
    "Popular Credit Card",
    "IDFC Bank Credit Card",
    "Axis Bank Credit Card",
    "HSBC Bank Credit Card",
    "AU Bank Credit Card",
    "American Express Credit Card",
    "ICICI Bank Credit Card",
    "IndusInd Bank Credit Cards",
  ]
  return (
    <AppBar
      sx={{
        backgroundColor: "white",
        boxShadow: "0px 4px 10px rgba(0, 0, 0, 0.1)",
        position: "fixed",
      }}
    >
      <Toolbar>
        <img
          src="https://cdn2.mymoneymantra.com/white_logo_d23b343666.webp?format=avif&quality=80&width=195&height=55"
          alt="logo"
          style={{
            filter: "invert(41%) sepia(95%) saturate(5935%) hue-rotate(162deg)",
            marginTop: "20px",
            marginBottom: "20px",
          }}
        />

        <Box sx={{ display: "flex", gap: 7, ml:2 }}>
          {[
            "Credit Cards",
            "Loan",
            "Insurance",
            "EMI Calculator",
            "Credit Score",
            "Blogs",
          ].map((item) => (
            <Typography
              key={item}
              sx={{
                color: "#0097a7",
                fontWeight: 700,
                fontSize: "16px",
                cursor: "pointer",
                transition: "color 0.3s",
              }}
            >
              {item}
            </Typography>
          ))}
        </Box>
      </Toolbar>
    </AppBar>
  );
}

export default Navbar;
